//import './App.css';
 import Home from './Component/Home/Home';
import React from "react"
//import Navbar from "./Component/Navbar/Navbar";
import Sidebar from "./Component/About/Sidebar";
import { BrowserRouter, Routes, Route } from "react-router-dom";
//import SidebarData from '/Component/About/SidebarData'
import Startups from './Component/Startups/Startups';
import Enterprise from './Component/Enterprise/Enterprise';
import Carrer from './'
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
      <Route path="/" element={<Home/>}>Home</Route>
      <Route path="/hello" element={<Sidebar/>}></Route>
      <Route path="/startups" element={<Startups/>}></Route>
      <Route path="/enterprise" element={<Enterprise/>}></Route>
      <Route path="/carrer" element={<Carrer/>}></Route>


      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
